			shellScript = "#Change the path to the linked library to work in standalone\ninstall_name_tool -change QtCore.framework/Versions/4/QtCore @executable_path/../Resources/QtCore \"${BUILT_PRODUCTS_DIR}/${CONTENTS_FOLDER_PATH}/Resources/QtGui\"\n\ninstall_name_tool -change /usr/local/lib/libDiagLib.dylib @executable_path/../Resources/libDiagLib.dylib \"${BUILT_PRODUCTS_DIR}/${CONTENTS_FOLDER_PATH}/Resources/libDiagEngine.dylib\"\n\ninstall_name_tool -change /usr/local/lib/libDiagLib.dylib @executable_path/../Resources/libDiagLib.dylib \"${BUILT_PRODUCTS_DIR}/${CONTENTS_FOLDER_PATH}/MacOS/eDTGui\"\ninstall_name_tool -change /usr/local/lib/libDiagEngine.dylib @executable_path/../Resources/libDiagEngine.dylib \"${BUILT_PRODUCTS_DIR}/${CONTENTS_FOLDER_PATH}/MacOS/eDTGui\"\ninstall_name_tool -change QtCore.framework/Versions/4/QtCore @executable_path/../Resources/QtCore \"${BUILT_PRODUCTS_DIR}/${CONTENTS_FOLDER_PATH}/MacOS/eDTGui\"\ninstall_name_tool -change QtGui.framework/Versions/4/QtGui @executable_path/../Resources/QtGui \"${BUILT_PRODUCTS_DIR}/${CONTENTS_FOLDER_PATH}/MacOS/eDTGui\"\n\n#Copy the Info.plist into the bundle\ncp -f \"${PROJECT_DIR}/eDTGui-Info.plist\" \"${BUILT_PRODUCTS_DIR}/${CONTENTS_FOLDER_PATH}/Info.plist\"\n\n### MAKE DMG\n#Get the build version\nbuild=`cat \"${PROJECT_DIR}/../svn_revision\"`\n\n#Detach and delete existing dmg\nif [ -e /Volumes/eDT ] \nthen \nhdiutil detach /Volumes/eDT\nfi\n\nif [ -e \"${BUILT_PRODUCTS_DIR}/eDT-uncompressed.dmg\" ] \nthen \nrm \"${BUILT_PRODUCTS_DIR}/eDT-uncompressed.dmg\"\nfi\n\nif [ -e \"${BUILT_PRODUCTS_DIR}/eDT.dmg\" ] \nthen \nrm \"${BUILT_PRODUCTS_DIR}/eDT.dmg\"\nfi\n\nif [ -e \"${BUILT_PRODUCTS_DIR}/eDT-$build.dmg\" ] \nthen \nrm \"${BUILT_PRODUCTS_DIR}/eDT-$build.dmg\"\nfi\n\n#Create an uncompressed image\nhdiutil create -size 50m -type UDIF -fs HFS+ -volname eDT \"${BUILT_PRODUCTS_DIR}/eDT-uncompressed.dmg\"\n\n#Open the uncompressed dmg and Copy the bundle into it\nhdiutil attach \"${BUILT_PRODUCTS_DIR}/eDT-uncompressed.dmg\"\ncp -R -f \"${BUILT_PRODUCTS_DIR}/${FULL_PRODUCT_NAME}\" /Volumes/eDT/\ncp -f \"${PROJECT_DIR}/DMG_DS_Store\" /Volumes/eDT/.DS_Store\ncp -f \"${PROJECT_DIR}/DmgBackground.jpg\" /Volumes/eDT/\n/Developer/Tools/SetFile -a V /Volumes/eDT/DmgBackground.jpg\ncp -f \"${PROJECT_DIR}/.VolumeIcon.icns\" /Volumes/eDT/\n/Developer/Tools/SetFile -a C /Volumes/eDT/\n\n#Close the uncompress dmg\nhdiutil detach /Volumes/eDT\n\n#Convert to Read-Only/Compressed\nhdiutil convert -format UDCO \"${BUILT_PRODUCTS_DIR}/eDT-uncompressed.dmg\" -o \"${BUILT_PRODUCTS_DIR}/eDT.dmg\"\n\n#Insert the resource file\n#hdiutil unflatten \"${BUILT_PRODUCTS_DIR}/eDT.dmg\"\n#/Developer/Tools/Rez -a \"${PROJECT_DIR}/sla.r\" -o \"${BUILT_PRODUCTS_DIR}/eDT.dmg\"\n#hdiutil flatten \"${BUILT_PRODUCTS_DIR}/eDT.dmg\"\n\nmv \"${BUILT_PRODUCTS_DIR}/eDT.dmg\" \"${BUILT_PRODUCTS_DIR}/eDT-$build.dmg\"\n";
